import React, { Component } from "react";
import "./App.css";
import Nav from "./components/Nav";
import Home from "./components/Home";
import Footer from "./components/Footer";
import DangKy from "./components/DangKy";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav></Nav>
        <DangKy></DangKy>
        <Footer></Footer>
      </div>
    );
  }
}
export default App;
